import React from "react";
import "./footer.css";
import {Container,Row,Col, ListGroup, ListGropuItem} from "reactstrap";
import {Link} from "react-router-dom";
import logo from "../../assets/images/logo.jpg";

const quick__links = [
    {
        path:"/gallery",
        display:"Gallery",
    },
    {
        path:"/login",
        display:"Login",
    },
    {
        path:"/register",
        display:"Resgister",
    },
];

const quick__links2 = [
    {
        path:"/home",
        display:"Home",
    },
    {
        path:"/about",
        display:"About",
    },
    {
        path:"/tours",
        display:"Tours",
    },
];

const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg="3">
                        <div className="logo">
                            <img src={logo} alt=""/>
                            <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Commodi,enim.</p>
                            <div className="social__links d-flex align-items-center gap-4">
                                <span>
                                    <Link to='#'><i class="ri-youtube-line"></i></Link>
                                </span>
                                <span>
                                    <Link to='#'><i class="ri-github-fill"></i></Link>
                                </span>
                                <span>
                                    <Link to='#'><i class="ri-facebook-circle-line"></i></Link>
                                </span>
                                <span>
                                    <Link to='#'><i class="ri-instagram-line"></i></Link>
                                </span>
                            </div>
                        </div>
                    </Col>
                    <Col lg='3'>
                        <h5 className="footer__link-title">Discover</h5>
                        <ListGroup className="footer__quick-links">
                            {quick__links.map((item,index)=>(
                                <ListGropuItem key={index} className="ps-0 border-0">
                                    <Link o={item.path}>{item.display}</Link>
                                </ListGropuItem>
                            ))}
                        </ListGroup>
                    </Col>
                    <Col lg='3'>
                    <h5 className="footer__link-title">Quick Links</h5>
                        <ListGroup className="footer__quick-links">
                            {quick__links2.map((item,index)=>(
                                <ListGropuItem key={index} className="ps-0 border-0">
                                    <Link o={item.path}>{item.display}</Link>
                                </ListGropuItem>
                            ))}
                        </ListGroup>
                    </Col>
                    <Col lg='3'></Col>
                </Row>
            </Container>
        </footer>
    );
};

export default Footer;
